INSERT INTO `contenuti_translations` (`id`, `contenuti_id`, `testo`, `locale`)
VALUES
	(1,1,'<p>Con una esperienza consolidata nella produzione di penicilline sterili, IBI &egrave; presente in 30 paesi con tutta la gamma dei suoi prodotti, approvati dalle Autorit&agrave; Sanitarie pi&ugrave; esigenti (US FDA, Australian TGA, UK MHRA , AIFA).</p>\r\n','it'),
	(2,1,'<p>Con una esperienza consolidata nella produzione di penicilline sterili, IBI &egrave; presente in 30 paesi con tutta la gamma dei suoi prodotti, approvati dalle Autorit&agrave; Sanitarie pi&ugrave; esigenti (US FDA, Australian TGA, UK MHRA , AIFA).</p>\r\n','en'),
	(3,2,'<p>Leader nella produzione di&nbsp; &beta;-lattamici, IBI &nbsp;si &egrave; affidata al marchio &nbsp;IBISQUS per una distribuzione di qualit&agrave; diretta al Canale Ospedaliero Europeo.</p>\r\n','it'),
	(4,2,'<p>Leader nella produzione di&nbsp; &beta;-lattamici, IBI &nbsp;si &egrave; affidata al marchio &nbsp;IBISQUS per una distribuzione di qualit&agrave; diretta al Canale Ospedaliero Europeo.</p>\r\n','en'),
	(5,3,'<h2>IBI: 90 anni di esperienza</h2>\r\n\r\n<h3>LA NOSTRA STORIA, I NOSTRI VALORI</h3>\r\n\r\n<h2><img src=\"http://ibi.dev/img/home-content-img.jpg\" /></h2>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano, Ibi, fondato dal Prof. Giovanni Lorenzini, &egrave; un&rsquo;azienda farmaceutica di grande tradizione scientifica presente sul mercato italiano da pi&ugrave; di 90 anni, con obiettivi di ricerca, innovazione e produzione. Oltre la tradizione storica aziendale, le nuove tecnologie applicate e un&rsquo;attenta cura nella produzione, fanno della Ibi sinonimo di affidabilit&agrave; e garanzia di alta qualit&agrave; nei paesi in cui l&rsquo;Azienda &egrave; presente.</p>\r\n\r\n<p>Ibi dedica la propria attivit&agrave; allo sviluppo di nuove applicazioni terapeutiche per offrire soluzioni alternative a medici e pazienti ed &egrave; oggi una realt&agrave; consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>La sede si trova ad Aprilia dove, oltre allo stabilimento di produzione, sono collocate tutte le funzioni aziendali. La produzione e il controllo qualit&agrave; sono il core business dell&rsquo;Azienda, a cui si affiancano Ricerca e Sviluppo, Farmacovigilanza...</p>\r\n','it'),
	(6,3,'<h2>IBI: 90 anni di esperienza</h2>\r\n\r\n<h3>LA NOSTRA STORIA, I NOSTRI VALORI</h3>\r\n\r\n<h2><img src=\"http://ibi.dev/img/home-content-img.jpg\" /></h2>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano, Ibi, fondato dal Prof. Giovanni Lorenzini, &egrave; un&rsquo;azienda farmaceutica di grande tradizione scientifica presente sul mercato italiano da pi&ugrave; di 90 anni, con obiettivi di ricerca, innovazione e produzione. Oltre la tradizione storica aziendale, le nuove tecnologie applicate e un&rsquo;attenta cura nella produzione, fanno della Ibi sinonimo di affidabilit&agrave; e garanzia di alta qualit&agrave; nei paesi in cui l&rsquo;Azienda &egrave; presente.</p>\r\n\r\n<p>Ibi dedica la propria attivit&agrave; allo sviluppo di nuove applicazioni terapeutiche per offrire soluzioni alternative a medici e pazienti ed &egrave; oggi una realt&agrave; consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>La sede si trova ad Aprilia dove, oltre allo stabilimento di produzione, sono collocate tutte le funzioni aziendali. La produzione e il controllo qualit&agrave; sono il core business dell&rsquo;Azienda, a cui si affiancano Ricerca e Sviluppo, Farmacovigilanza...</p>\r\n','en'),
	(7,4,'<p>Sul mercato italiano IBI &egrave; presente con prodotti che vanno dalle penicilline sterili agli&nbsp;integratori alimentari, in varie aree terapeutiche: gastroenterologia, anestesiologia e area infiammazione e dolore.</p>\r\n','it'),
	(8,4,'<p>Sul mercato italiano IBI &egrave; presente con prodotti che vanno dalle penicilline sterili agli&nbsp;integratori alimentari, in varie aree terapeutiche: gastroenterologia, anestesiologia e area infiammazione e dolore.</p>\r\n','en'),
	(9,5,'<p>Una struttura organizzativa in grado di seguire con competenza e professionalit&agrave; &egrave; in grado di seguire tutto l&rsquo;iter di sviluppo di un farmaco: dagli studi clinici alla produzione e commercializzazione.</p>\r\n','it'),
	(10,5,'<p>Una struttura organizzativa in grado di seguire con competenza e professionalit&agrave; &egrave; in grado di seguire tutto l&rsquo;iter di sviluppo di un farmaco: dagli studi clinici alla produzione e commercializzazione.</p>\r\n','en'),
	(11,6,'<h2>IBI: 90 anni di esperienza</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p><img src=\"/img/home-content-img.jpg\" /></p>\r\n\r\n<p>ITA L&rsquo;Istituto Biochimico Italiano, Ibi, fondato dal Prof. Giovanni Lorenzini, &egrave; un&rsquo;azienda farmaceutica di grande tradizione scientifica presente sul mercato italiano da pi&ugrave; di 90 anni, con obiettivi di ricerca, innovazione e produzione. Oltre la tradizione storica aziendale, le nuove tecnologie applicate e un&rsquo;attenta cura nella produzione, fanno della Ibi sinonimo di affidabilit&agrave; e garanzia di alta qualit&agrave; nei paesi in cui l&rsquo;Azienda &egrave; presente.</p>\r\n\r\n<p>Ibi dedica la propria attivit&agrave; allo sviluppo di nuove applicazioni terapeutiche per offrire soluzioni alternative a medici e pazienti ed &egrave; oggi una realt&agrave; consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>La sede si trova ad Aprilia dove, oltre allo stabilimento di produzione, sono collocate tutte le funzioni aziendali. La produzione e il controllo qualit&agrave; sono il core business dell&rsquo;Azienda, a cui si affiancano Ricerca e Sviluppo, Farmacovigilanza, Informazione Scientifica e tutti i servizi che ruotano intorno alla vita del farmaco, in una realt&agrave; aziendale consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>Con i suoi 18.000 mq di impianti ed un edificio completamente dedicato alla produzione di penicilline &beta;-lattamiche, Ibi offre servizi e tecnologia all&rsquo;avanguardia che la posizionano tra le prime 10 aziende italiane nella produzione conto terzi di diverse molecole. Ibi &egrave; oggi presente in pi&ugrave; di 30 paesi con l&rsquo;esportazione di gran parte dei suoi prodotti, pari ai 2/3 della produzione ed &egrave; una delle poche aziende, fuori dal territorio americano, ad aver ottenuto l&rsquo;approvazione dell&rsquo;FDA per la produzione di penicilline sterili per il mercato statunitense.</p>\r\n\r\n<p>Ibi ha sviluppato una strategia di distribuzione negli ospedali affidando la commercializzazione dei prodotti ad una struttura dedicata, Ibisqus, oggi presente in UK, Germania ed Italia. Sul mercato italiano &egrave; presente con diversi prodotti, dalle penicilline sterili agli integratori alimentari. Ha una presenza consolidata nell&rsquo;antibioticoterapia e in gastroenterologia.</p>\r\n\r\n<p>Ibi raggiunge direttamente 4.000 farmacie e 3.000 specialisti grazie ad una rete di informatori scientifici qualificati e, indirettamente, oltre 6.000 medici di base con attivit&agrave; di direct mailing, detailing e newsletter.</p>\r\n\r\n<p>Sul mercato italiano &egrave; presente con una variet&agrave; di prodotti, dalle penicilline sterili agli integratori alimentari con una presenza consolidata nell&rsquo;antibioticoterapia oltre diverse aree terapeutiche, quali gastroenterologia, anestesiologia e area infiammazione e dolore.</p>\r\n\r\n<div class=\"evidence-box\">\r\n<h4>Il sito internet</h4>\r\n\r\n<p>ITA Con la realizzazione di questo sito web, la IBI desidera informare il pubblico sulle proprie attivit&agrave; aziendali e fornire agli operatori sanitari un quadro completo dei propri medicinali che possono essere forniti dietro presentazione di ricetta medica o SOP.</p>\r\n</div>\r\n','it'),
	(12,6,'<h2>IBI: 90 anni di esperienza</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p><img src=\"/img/home-content-img.jpg\" /></p>\r\n\r\n<p>ENG L&rsquo;Istituto Biochimico Italiano, Ibi, fondato dal Prof. Giovanni Lorenzini, &egrave; un&rsquo;azienda farmaceutica di grande tradizione scientifica presente sul mercato italiano da pi&ugrave; di 90 anni, con obiettivi di ricerca, innovazione e produzione. Oltre la tradizione storica aziendale, le nuove tecnologie applicate e un&rsquo;attenta cura nella produzione, fanno della Ibi sinonimo di affidabilit&agrave; e garanzia di alta qualit&agrave; nei paesi in cui l&rsquo;Azienda &egrave; presente.</p>\r\n\r\n<p>Ibi dedica la propria attivit&agrave; allo sviluppo di nuove applicazioni terapeutiche per offrire soluzioni alternative a medici e pazienti ed &egrave; oggi una realt&agrave; consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>La sede si trova ad Aprilia dove, oltre allo stabilimento di produzione, sono collocate tutte le funzioni aziendali. La produzione e il controllo qualit&agrave; sono il core business dell&rsquo;Azienda, a cui si affiancano Ricerca e Sviluppo, Farmacovigilanza, Informazione Scientifica e tutti i servizi che ruotano intorno alla vita del farmaco, in una realt&agrave; aziendale consolidata in Italia, Europa, Asia, Australia e US.</p>\r\n\r\n<p>Con i suoi 18.000 mq di impianti ed un edificio completamente dedicato alla produzione di penicilline &beta;-lattamiche, Ibi offre servizi e tecnologia all&rsquo;avanguardia che la posizionano tra le prime 10 aziende italiane nella produzione conto terzi di diverse molecole. Ibi &egrave; oggi presente in pi&ugrave; di 30 paesi con l&rsquo;esportazione di gran parte dei suoi prodotti, pari ai 2/3 della produzione ed &egrave; una delle poche aziende, fuori dal territorio americano, ad aver ottenuto l&rsquo;approvazione dell&rsquo;FDA per la produzione di penicilline sterili per il mercato statunitense.</p>\r\n\r\n<p>Ibi ha sviluppato una strategia di distribuzione negli ospedali affidando la commercializzazione dei prodotti ad una struttura dedicata, Ibisqus, oggi presente in UK, Germania ed Italia. Sul mercato italiano &egrave; presente con diversi prodotti, dalle penicilline sterili agli integratori alimentari. Ha una presenza consolidata nell&rsquo;antibioticoterapia e in gastroenterologia.</p>\r\n\r\n<p>Ibi raggiunge direttamente 4.000 farmacie e 3.000 specialisti grazie ad una rete di informatori scientifici qualificati e, indirettamente, oltre 6.000 medici di base con attivit&agrave; di direct mailing, detailing e newsletter.</p>\r\n\r\n<p>Sul mercato italiano &egrave; presente con una variet&agrave; di prodotti, dalle penicilline sterili agli integratori alimentari con una presenza consolidata nell&rsquo;antibioticoterapia oltre diverse aree terapeutiche, quali gastroenterologia, anestesiologia e area infiammazione e dolore.</p>\r\n\r\n<div class=\"evidence-box\">\r\n<h4>Il sito internet</h4>\r\n\r\n<p>ENG Con la realizzazione di questo sito web, la IBI desidera informare il pubblico sulle proprie attivit&agrave; aziendali e fornire agli operatori sanitari un quadro completo dei propri medicinali che possono essere forniti dietro presentazione di ricetta medica o SOP.</p>\r\n</div>\r\n','en'),
	(13,7,'<h2>IBI: Il Gruppo</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p>IBIGEN &egrave; al vertice di un gruppo farmaceutico di importante tradizione scientifica, operante sul mercato italiano ed internazionale da pi&ugrave; di novant&rsquo;anni. Il Gruppo &egrave; storicamente attivo nel settore della ricerca e della produzione di prodotti farmaceutici, per conto proprio e di terzi, attraverso la societ&agrave; Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (&ldquo;<strong>IBI</strong>&rdquo;), con sede ad Aprilia, dove &egrave; localizzato l&rsquo;attuale stabilimento di produzione.</p>\r\n\r\n<p>Fino al 2007 il gruppo distribuiva all&rsquo;estero i propri prodotti al settore ospedaliero avvalendosi della collaborazione di distributori commerciali indipendenti. La vendita in Italia era affidata ad IBI che vendeva direttamente ad ospedali e farmacie.</p>\r\n\r\n<p>Dal 2007 il gruppo &egrave; entrato anche nel settore della distribuzione diretta agli ospedali europei, creando il ramo di business denominato IBisqus con delle apposite societ&agrave; distributrici (IBISQUS S.r.l. in Italia, IBISQUS GmbH in Germania e BOWMED IBISQUS ltd nel Regno Unito) per una distribuzione dedicata che garantisca un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n\r\n<p>Il gruppo ha sempre avuto una sua caratterizzazione e vocazione internazionale ed il trend delle vendite degli ultimo anni ha presentato circa &frac34; delle proprie vendite verso i mercati esteri. L&rsquo;attenzione alla qualit&agrave;, la competenza e la professionalit&agrave;, permettono al Gruppo di rispondere alle sfide interne ed esterne in modo rapido ed efficiente.</p>\r\n','it'),
	(14,7,'<h2>IBI: Il Gruppo</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p>IBIGEN &egrave; al vertice di un gruppo farmaceutico di importante tradizione scientifica, operante sul mercato italiano ed internazionale da pi&ugrave; di novant&rsquo;anni. Il Gruppo &egrave; storicamente attivo nel settore della ricerca e della produzione di prodotti farmaceutici, per conto proprio e di terzi, attraverso la societ&agrave; Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (&ldquo;<strong>IBI</strong>&rdquo;), con sede ad Aprilia, dove &egrave; localizzato l&rsquo;attuale stabilimento di produzione.</p>\r\n\r\n<p>Fino al 2007 il gruppo distribuiva all&rsquo;estero i propri prodotti al settore ospedaliero avvalendosi della collaborazione di distributori commerciali indipendenti. La vendita in Italia era affidata ad IBI che vendeva direttamente ad ospedali e farmacie.</p>\r\n\r\n<p>Dal 2007 il gruppo &egrave; entrato anche nel settore della distribuzione diretta agli ospedali europei, creando il ramo di business denominato IBisqus con delle apposite societ&agrave; distributrici (IBISQUS S.r.l. in Italia, IBISQUS GmbH in Germania e BOWMED IBISQUS ltd nel Regno Unito) per una distribuzione dedicata che garantisca un&rsquo;alta qualit&agrave; dei servizi offerti.</p>\r\n\r\n<p>Il gruppo ha sempre avuto una sua caratterizzazione e vocazione internazionale ed il trend delle vendite degli ultimo anni ha presentato circa &frac34; delle proprie vendite verso i mercati esteri. L&rsquo;attenzione alla qualit&agrave;, la competenza e la professionalit&agrave;, permettono al Gruppo di rispondere alle sfide interne ed esterne in modo rapido ed efficiente.</p>\r\n','en'),
	(15,8,'<h2>IBI: La Storia</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p><img src=\"/img/storia.jpg\" /></p>\r\n\r\n<p>Raccontare la storia di Ibi vuol dire parlare di un passato ricco di soddisfazioni, di imprenditorialit&agrave; e capacit&agrave;. Un passato fatto di uomini, creativit&agrave;, strategie lungimiranti, di volont&agrave; nella ricerca del miglioramento continuo e di determinazione nell&rsquo;affrontare le sfide: tutto questo &egrave; Ibi, una storia ed una realt&agrave; italiane.</p>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.a. (IBI), una delle realt&agrave; farmaceutiche tradizionali nel panorama italiano, venne fondato a Milano nel 1918 dal Prof. Giovanni Lorenzini. Sotto la sua guida il lavoro della Ibi venne finalizzato alla ricerca ed alla produzione farmaceutica, in particolare nel campo delle vitamine. Proprio agli albori degli studi su queste sostanze, vennero sviluppate in IBI ricerche sui metodi di estrazione, dosaggio, stabilizzazione delle vitamine allora appena scoperte e venne elaborato il primo prodotto polivitaminico per uso terapeutico, la ben nota Vitamina Lorenzini.</p>\r\n\r\n<p>Grazie al desiderio del Prof. Lorenzini di voler offrire un servizio alla societ&agrave; &egrave; nata la missione &ldquo;Fare per Dare&rdquo; che la IBI persegue dunque fin dalla sua fondazione e che gli ha permesso durante il periodo delle due Guerre mondiali di svolgere un ruolo sociale importante e di soddisfare il fabbisogno nazionale di acido ascorbico, tiamina ed insulina.</p>\r\n\r\n<p>A partire dal 1940 inizia la &ldquo;conduzione femminile&rdquo; della IBI, infatti, alla morte del suo fondatore, l&rsquo;azienda passa sotto la direzione della figlia Loredana Lorenzini e rivolge tutte le sue attenzioni allo sviluppo del settore specialit&agrave; etiche per il mercato italiano ed all&rsquo;esportazione in tutto il mondo di prodotti finiti e in bulk. A partire dal 1956 gli antibiotici diventano il punto focale della ricerca IBI, che sviluppa metodi produttivi pi&ugrave; efficienti di nuovi derivati semisintetici di antibiotici garantendone la qualit&agrave;.</p>\r\n\r\n<p>A testimonianza dell&rsquo;elevato livello qualitativo raggiunto, la Ibi &egrave; una delle prime aziende italiane ad ottenere nel 1961 la prima certificazione FDA all&rsquo;esportazione in USA di antibiotici beta lattamici ed orali. Negli anni &rsquo;70 si apre un periodo di cessione di Know How che la vede impegnata nella costruzione di importanti impianti di produzione di antibiotici all&rsquo;estero ( Algeria, Cuba, Nigeria, Egitto, Panama). Si rende necessario un ampliamento alla sede amministrativa e dirigenziale ormai ubicata in pieno centro a Milano, nel 1974 si inaugura l&rsquo;unit&agrave; produttiva di Aprilia, oggi sede aziendale. In questi anni, sotto la guida di questa donna tenace e determinata l&rsquo;azienda arriva ad essere negli anni ottanta una tra le prime industrie farmaceutiche nel panorama italiano.</p>\r\n\r\n<p>Nel 1990 assistiamo ad un ricambio generazionale. A Loredana Lorenzini succede la nipote Camilla Borghese Khevenh&uuml;ller, attuale presidente e amministratore delegato. Dopo circa 70 anni dalla sua nascita la IBI si trova a dover affrontare i profondi mutamenti del settore farmaceutico italiano. Inizia in questi anni una riorganizzazione che prevede il rinnovo del listino dei prodotti , il potenziamento della struttura commerciale in Italia. La razionalizzazione delle risorse porta alla concentrazione nell&rsquo;unico sito di Aprilia sia della produzione negli anni novanta che degli uffici nel 2003. Il rinnovamento del management da un nuovo impulso allo sviluppo aziendale consolidando ed espandendo sia i mercati nazionali che internazionali. Ibi diventa cos&igrave; un marchio riconosciuto nel mondo sia come esportatore di materie prime sia di prodotti confezionati.</p>\r\n\r\n<p>Nel 2004 IBI &egrave; il fornitore privilegiato di importanti aziende in UK, USA, Germania ed Australia. Le prospettive di crescita nel mercato estero prospettano la necessit&agrave; di produrre maggiori volumi, viene cos&igrave; inaugurato nel 2007 un nuovo edificio interamente dedicato alla produzione di beta lattamici.</p>\r\n\r\n<p>Nel 2006 Ibi avverte la necessit&agrave; di adeguare la propria organizzazione ad una dimensione europea per rispondere in modo adeguato all&rsquo;affermarsi delle aziende specializzate nei farmaci equivalenti. Insieme ad un noto gruppo europeo viene fondata la Ibisqus, dedicata alla commercializzazione in ospedale in UK, Italia e Germania.</p>\r\n\r\n<p>Anche nel presente la IBI persegue la vocazione di continuare a rappresentare una moderna e creativa realt&agrave; nel panorama farmaceutico nazionale. Non si ferma davanti agli scenari in continuo movimento e neanche di fronte alle nuove tecnologie facendole proprie. In questa prospettiva di sviluppo la IBI si &egrave; affiancata al mondo della Nanomedicina che si sta sempre pi&ugrave; affermando. Ha rinnovato il proprio Know How ed i laboratori ed &egrave; pronta per nuove sfide per offrire strumenti e prodotti in linea con la missione iniziale del suo fondatore &ldquo;fare per dare&rdquo; al fine di migliorare la qualit&agrave; della vita.</p>\r\n','it'),
	(16,8,'<h2>IBI: La Storia</h2>\r\n\r\n<h3>La nostra storia, i nostri valori</h3>\r\n\r\n<p><img src=\"/img/storia.jpg\" /></p>\r\n\r\n<p>Raccontare la storia di Ibi vuol dire parlare di un passato ricco di soddisfazioni, di imprenditorialit&agrave; e capacit&agrave;. Un passato fatto di uomini, creativit&agrave;, strategie lungimiranti, di volont&agrave; nella ricerca del miglioramento continuo e di determinazione nell&rsquo;affrontare le sfide: tutto questo &egrave; Ibi, una storia ed una realt&agrave; italiane.</p>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.a. (IBI), una delle realt&agrave; farmaceutiche tradizionali nel panorama italiano, venne fondato a Milano nel 1918 dal Prof. Giovanni Lorenzini. Sotto la sua guida il lavoro della Ibi venne finalizzato alla ricerca ed alla produzione farmaceutica, in particolare nel campo delle vitamine. Proprio agli albori degli studi su queste sostanze, vennero sviluppate in IBI ricerche sui metodi di estrazione, dosaggio, stabilizzazione delle vitamine allora appena scoperte e venne elaborato il primo prodotto polivitaminico per uso terapeutico, la ben nota Vitamina Lorenzini.</p>\r\n\r\n<p>Grazie al desiderio del Prof. Lorenzini di voler offrire un servizio alla societ&agrave; &egrave; nata la missione &ldquo;Fare per Dare&rdquo; che la IBI persegue dunque fin dalla sua fondazione e che gli ha permesso durante il periodo delle due Guerre mondiali di svolgere un ruolo sociale importante e di soddisfare il fabbisogno nazionale di acido ascorbico, tiamina ed insulina.</p>\r\n\r\n<p>A partire dal 1940 inizia la &ldquo;conduzione femminile&rdquo; della IBI, infatti, alla morte del suo fondatore, l&rsquo;azienda passa sotto la direzione della figlia Loredana Lorenzini e rivolge tutte le sue attenzioni allo sviluppo del settore specialit&agrave; etiche per il mercato italiano ed all&rsquo;esportazione in tutto il mondo di prodotti finiti e in bulk. A partire dal 1956 gli antibiotici diventano il punto 