	(35,18,'The Biotech Dept. at IBI-Lorenzini is committed to the production of recombinant proteins from CHO cells.                           In 2015 we have received the GMP authorization from the Italian Regulatory Agency (AIFA, authorization number UAO/103050/P) for the production of the recombinant human BMP4 (Bone Morphogenetic Protein). This protein has obtained the Orphan Drug designation from EMA                          (http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b) for the treatment of glioma.                          The Biotech Dept. is also dedicated to bring innovative oncology products into clinic. We are developing a humanized monoclonal antibody anti-HER2 with groundbreaking features over the actual marketed antibodies for the treatment of HER2 expressing tumors.                          Finally, we have an established production process for the biosimilar eythropoietin alpha.','it'),
	(36,18,'The Biotech Dept. at IBI-Lorenzini is committed to the production of recombinant proteins from CHO cells.                           In 2015 we have received the GMP authorization from the Italian Regulatory Agency (AIFA, authorization number UAO/103050/P) for the production of the recombinant human BMP4 (Bone Morphogenetic Protein). This protein has obtained the Orphan Drug designation from EMA                          (http://www.ema.europa.eu/ema/index.jsp?curl=pages/medicines/human/orphans/2014/11/human_orphan_001433.jsp&amp;mid=WC0b01ac058001d12b) for the treatment of glioma.                          The Biotech Dept. is also dedicated to bring innovative oncology products into clinic. We are developing a humanized monoclonal antibody anti-HER2 with groundbreaking features over the actual marketed antibodies for the treatment of HER2 expressing tumors.                          Finally, we have an established production process for the biosimilar eythropoietin alpha.','en'),
	(37,19,'All the GMP equipment are under constant and registered control through a validated system of probes and alarms (TESTO).                          <br><br><b>Upstream</b>                          <ul>                            <li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>                            <li>n. 1 SIP Bioreactor 30 L (Applikon)</li>                            <li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>                            <li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>                            <li>-80¬∞C, -20¬∞C and +4¬∞C refrigerators</li>                            <li>Nucleocounter for cell counting												</li>                          </ul><b>Downstream</b>                          <ul>                            <li>Akta Pilot (GE Healthcare)</li>                            <li>Akta Explorer (GE Healthcare)</li>                            <li>Sartoflow alpha for TFF</li>                            <li>Viral Inactivation and Removal</li>                            <li>Hollow fibers (GE Healthcare) for the concentration of proteins			</li>                          </ul><b>Analysis</b>                          <ul>                            <li>HPLC (Waters)</li>                            <li>UV-Vis spectrophotometer (Perkin Elmer)</li>                            <li>Capillary Electrophoresis (Beckman &amp; Coulter)</li>                            <li>Chemidoc (Bio-Rad)</li>                            <li>ELISA reader (BMG)</li>                            <li>ELISA plate washer (Tecan)</li>                            <li>BioLayerInterferometry (BLITZ-Fortebio)</li>                            <li>Cell-based potency assays</li>                            <li>Real-Time PCR (Applied Biosystems 7500)</li>                            <li>Flow Cytometer (EasyCube-Sysmex)																							</li>                          </ul>','it'),
	(38,19,'All the GMP equipment are under constant and registered control through a validated system of probes and alarms (TESTO).                          <br><br><b>Upstream</b>                          <ul>                            <li>n. 2 wave Bioreactors 20/50 (GE Healthcare)</li>                            <li>n. 1 SIP Bioreactor 30 L (Applikon)</li>                            <li>n. 3 CO2 incubators (Thermo Fisher and Eppendorf-Si41 with integrated shaker)</li>                            <li>n. 2 Liquid nitrogen Dewars (Thermo Fisher and MV2000)</li>                            <li>-80¬∞C, -20¬∞C and +4¬∞C refrigerators</li>                            <li>Nucleocounter for cell counting												</li>                          </ul><b>Downstream</b>                          <ul>                            <li>Akta Pilot (GE Healthcare)</li>                            <li>Akta Explorer (GE Healthcare)</li>                            <li>Sartoflow alpha for TFF</li>                            <li>Viral Inactivation and Removal</li>                            <li>Hollow fibers (GE Healthcare) for the concentration of proteins			</li>                          </ul><b>Analysis</b>                          <ul>                            <li>HPLC (Waters)</li>                            <li>UV-Vis spectrophotometer (Perkin Elmer)</li>                            <li>Capillary Electrophoresis (Beckman &amp; Coulter)</li>                            <li>Chemidoc (Bio-Rad)</li>                            <li>ELISA reader (BMG)</li>                            <li>ELISA plate washer (Tecan)</li>                            <li>BioLayerInterferometry (BLITZ-Fortebio)</li>                            <li>Cell-based potency assays</li>                            <li>Real-Time PCR (Applied Biosystems 7500)</li>                            <li>Flow Cytometer (EasyCube-Sysmex)																							</li>                          </ul>','en'),
	(39,20,'<ul>                            <li>Production of recombinant antibodies against ErbB2 for cancer therapy	(funded by Italian Scientific Research Fund FILAS 2008)  </li>                            <li>                                                             A breast cancer toolbox: HER2 targeted immuno-conjugate as therapeutic and diagnostic tools (https://www.eurostars-eureka.eu/project//id/5995  funded by Eurostars 2010-2014).                            </li>                            <li>3WAYNEPO: Novel Nanoformulations of low sialic recombinant erythropoietin for treatment of Alzheimer‚Äôs disease and cerebral ischemia/reperfusion injury. (submitted for the H2020 NMBP-10-2016-2017 Proposal number: 720845-1)													</li>                          </ul>','it'),
	(40,20,'<ul>                            <li>Production of recombinant antibodies against ErbB2 for cancer therapy	(funded by Italian Scientific Research Fund FILAS 2008)  </li>                            <li>                                                             A breast cancer toolbox: HER2 targeted immuno-conjugate as therapeutic and diagnostic tools (https://www.eurostars-eureka.eu/project//id/5995  funded by Eurostars 2010-2014).                            </li>                            <li>3WAYNEPO: Novel Nanoformulations of low sialic recombinant erythropoietin for treatment of Alzheimer‚Äôs disease and cerebral ischemia/reperfusion injury. (submitted for the H2020 NMBP-10-2016-2017 Proposal number: 720845-1)													</li>                          </ul>','en'),
