	(47,24,'<p>A quasi 100 anni dalla data della sua fondazione l‚ÄôIstituto Biochimico Italiano ha intrapreso una strategia di crescita e di rinnovamento con l‚Äôobiettivo di competere a livello internazionale.</p>            <p>La prima azienda del gruppo IBI, la IBIGEN, grazie alla joint venture con un gruppo internazionale, ha dato vita nel 2007 ad una nuova realt√† chiamata IBISQUS presente in UK, Germania ed Italia.</p>            <p>              IBISQUS Italia in modo snello ed efficiente, commercializza 23 principi attivi per un totale di 58 diversi farmaci generici, di titolarit√† A.I.C. della Ibi, della Ibigen e di altre Aziende esterne al gruppo, in tutte le Strutture Sanitarie Nazionali a carattere sia Pubblico che Privato.              La profonda conoscenza del Canale Ospedaliero italiano e dei suoi intrinsechi fabbisogni, tramite la consolidata Forza Vendite Esterna, integrata dalla catena produttiva e dalla gestione back office delle vendite consentono di ottimizzare il servizio di distribuzione capillare su tutto territorio.            </p>            <p>Le competenze professionali, la collaborazione ad ogni livello e l‚Äôeticit√† sono i valori fondamentali dello spirito del Gruppo che permettono di rispondere alle sfide interne ed esterne in modo rapido ed efficiente.								</p>','it'),
