	(59,30,'<h2>Farmacovigilanza</h2>\r\n\r\n<h3>La sicurezza prima di tutto</h3>\r\n\r\n<p><img src=\"/img/home-content-img.jpg\" /></p>\r\n\r\n<p>Il servizio di Farmacovigilanza all&rsquo;interno dell&rsquo;Industria Farmaceutica ha il compito di raccogliere tutte le informazioni sulla sicurezza dei principi attivi dei farmaci di cui &egrave; titolare dell&rsquo;Autorizzazione all&rsquo;Immissione in Commercio (AIC), per migliorare le modalit&agrave; d&rsquo;impiego e ridurre, quando possibile, il rischio di effetti indesiderati.<br />\r\nA tal fine il Servizio di Farmacovigilanza raccoglie, valuta e analizza le segnalazioni di reazioni avverse pervenute spontaneamente e fornisce tali informazioni alle Autorit&agrave; Competenti, in modo tale da fornire informazioni utili alla salvaguardia della salute dei pazienti.<br />\r\n<br />\r\nInoltre il Servizio di Farmacovigilanza assicura che tutte le informazioni relative alla sicurezza dei farmaci siano portate rapidamente a conoscenza del personale sanitario.</p>\r\n\r\n<h4>Chi pu&ograve; segnalare?</h4>\r\n\r\n<p>La Farmacovigilanza coinvolge a diversi livelli tutta la comunit&agrave;: pazienti, proscrittori, operatori sanitari, aziende farmaceutiche, istituzioni ed accademia e la segnalazione pu&ograve; essere effettuata non solo dall&rsquo;operatore sanitario ma anche dai cittadini.</p>\r\n\r\n<h4>Come si effettua la segnalazione spontanea?</h4>\r\n\r\n<p>A partire dal 21 luglio 2012, gli operatori sanitari e/o i cittadini possono effettuare segnalazione spontanea di sospetta reazione avversa direttamente ad AIFA, mediante la compilazione della scheda cartacea o della scheda elettronica.<br />\r\n<br />\r\nLe modalit&agrave; di segnalazione sono descritte nel sito internet AIFA (Agenzia Italiana del Farmaco), al seguente <a href=\"http://www.agenziafarmaco.gov.it/it/content/modalit%C3%A0-di-segnalazione-delle-sospette-reazioni-avverse-ai-medicinali\" target=\"_blank\">link </a><br />\r\n<br />\r\nIn caso di reazioni avverse a prodotti a base di piante officinali e integratori alimentari, &egrave; possibile effettuare una segnalazione di sospetta reazione avversa al seguente <a href=\"http://www.epicentro.iss.it/focus/erbe/fitosorveglianza.asp\" target=\"_blank\">link </a></p>\r\n\r\n<h4>Quando segnalare?</h4>\r\n\r\n<p>Quando si sospetta che il farmaco sia causa dell&rsquo;effetto indesiderato (anche in caso di dubbio)<br />\r\n<br />\r\nIl Servizio di Farmacovigilanza per i prodotti medicinali distribuiti dalla societ&agrave; Ibisqus (concessionario di vendita), viene svolto dai rispettivi Titolari delle AIC (Autorizzazione all&rsquo;Immissione in Commercio).</p>\r\n\r\n<p>Per eventuali segnalazioni di effetti indesiderati riscontrati nel paziente in seguito ad impiego dei prodotti IBI o IBIGEN o per richiedere informazioni relative alla sicurezza dei farmaci di cui IBI o IBIGEN &egrave; titolare di AIC, &egrave; possibile contattare l&rsquo;Azienda compilando il seguente form:</p>\r\n','it'),
