	(73,37,'<h2>Privacy Policy</h2>\r\n\r\n<p>L&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (in seguito I.B.I.), tramite il sito www.ibi-lorenzini.it ha come obiettivo la tutela della privacy dei propri utenti e garantisce che il trattamento dei dati personali si svolga nel rispetto dei diritti, delle libert&agrave; fondamentali nonch&eacute; della dignit&agrave; delle persone, con particolare riferimento alla riservatezza e all&#39;identit&agrave; personale. Nel prestare i nostri servizi, entreremo necessariamente in possesso di informazioni e dati personali: intendiamo, perci&ograve;, qui di seguito, illustrare la policy privacy del nostro sito. Il Titolare del trattamento Il Titolare del trattamento dei dati personali trattati a seguito della consultazione del nostro sito, &egrave; I.B.I. S.p.A., con sede in Via Fossignano n&deg;2 Aprilia (LT).</p>\r\n\r\n<p><strong>Il Responsabile del trattamento</strong><br />\r\nIl Responsabile del trattamento &egrave; il Direttore del Personale, domiciliato per la funzione in Via Fossignano n. 2, Aprilia (LT) e l&rsquo;elenco aggiornato degli altri responsabili pu&ograve; essere visionato presso lo stesso.</p>\r\n\r\n<p><strong>Luogo e finalit&agrave; di trattamento dei dati</strong><br />\r\nI trattamenti connessi ai servizi web di questo sito hanno luogo presso la predetta sede della Societ&agrave; e sono curati solo da dipendenti e collaboratori da I.B.I. S.p.A. incaricati del trattamento e da eventuali incaricati di occasionali operazioni di manutenzione. L&#39;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&#39;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<p><strong>Comunicazione dei dati</strong><br />\r\nI dati forniti dagli utenti non saranno comunicati a soggetti terzi salvo che la comunicazione sia imposta da obblighi di legge o sia strettamente necessario per l&rsquo;adempimento delle richieste. Gli incaricati del trattamento che si occupano della gestione delle richieste, potranno venire a conoscenza dei suoi dati personali esclusivamente per le finalit&agrave; su menzionate.</p>\r\n\r\n<p><strong>Tipi di dati trattati</strong><br />\r\nDati forniti volontariamente dagli utenti L&rsquo;invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell&rsquo;indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva. Sintetiche informative di sintesi verranno progressivamente riportate o visualizzate nelle pagine del sito predisposte per particolari servizi.</p>\r\n\r\n<p><strong>Cookies</strong><br />\r\nPer cookies si intende un elemento testuale che viene inserito nel disco fisso di un computer solo in seguito ad autorizzazione. I cookies hanno la funzione di snellire l&rsquo;analisi del traffico su web o di segnalare quando un sito specifico viene visitato e consentono alle applicazioni web di inviare informazioni a singoli utenti. Nessun dato degli utenti viene in proposito acquisito dal sito. Non viene fatto uso di cookies per la trasmissione di informazioni di carattere personale, n&eacute; vengono utilizzati c.d. cookies persistenti di alcun tipo, ovvero sistemi per il tracciamento degli utenti.</p>\r\n\r\n<p><strong>Facoltativit&agrave; del conferimento dei dati</strong><br />\r\nA parte quanto specificato per i dati di navigazione, l&rsquo;utente &egrave; libero di fornire i dati personali per richiedere i servizi offerti dalla societ&agrave;. Il loro mancato conferimento pu&ograve; comportare l&rsquo;impossibilit&agrave; di ottenere il servizio richiesto.</p>\r\n\r\n<p><strong>Modalit&agrave; di trattamento dei dati</strong><br />\r\nI dati personali sono trattati con strumenti manuali e automatizzati, per il tempo necessario a conseguire lo scopo per il quale sono stati raccolti. I dati personali oggetto di trattamento saranno custoditi in modo da ridurre al minimo, mediante l&#39;adozione di idonee e preventive misure di sicurezza, i rischi di distruzione o perdita, anche accidentale, dei dati stessi, di accesso non autorizzato o di trattamento non consentito o non conforme alle finalit&agrave; della raccolta</p>\r\n\r\n<p><strong>Diritti degli interessati</strong><br />\r\nI soggetti cui si riferiscono i dati hanno i diritti previsti dall&rsquo;art. 7 del Codice privacy che riportiamo di seguito:</p>\r\n\r\n<ul>\r\n	<li>L&#39;interessato ha diritto di ottenere la conferma dell&#39;esistenza o meno di dati personali che lo riguardano, anche se non ancora registrati, e la loro comunicazione in forma intelligibile.</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) dell&#39;origine dei dati personali;</li>\r\n		<li>&nbsp; &nbsp; b) delle finalit&agrave; e modalit&agrave; del trattamento;</li>\r\n		<li>&nbsp; &nbsp; c) della logica applicata in caso di trattamento effettuato con l&#39;ausilio di strumenti elettronici;</li>\r\n		<li>&nbsp; &nbsp; d) degli estremi identificativi del titolare, dei responsabili e del rappresentante designato ai sensi dell&#39;articolo 5, comma 2;</li>\r\n		<li>&nbsp; &nbsp; e) dei soggetti o delle categorie di soggetti ai quali i dati personali possono essere comunicati o che possono venirne a conoscenza in qualit&agrave; di rappresentante designato nel territorio dello Stato, di responsabili o incaricati.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di ottenere:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) l&#39;aggiornamento, la rettificazione ovvero, quando vi ha interesse, l&#39;integrazione dei dati;</li>\r\n		<li>&nbsp; &nbsp; b) la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, compresi quelli di cui non &egrave; necessaria la conservazione in relazione agli scopi per i quali i dati sono stati raccolti o successivamente trattati;</li>\r\n		<li>&nbsp; &nbsp; c) l&#39;attestazione che le operazioni di cui alle lettere a) e b) sono state portate a conoscenza, anche per quanto riguarda il loro contenuto, di coloro ai quali i dati sono stati comunicati o diffusi, eccettuato il caso in cui tale adempimento si rivela impossibile o comporta un impiego di mezzi manifestamente sproporzionato rispetto al diritto tutelato.</li>\r\n	</ul>\r\n	</li>\r\n	<li>L&#39;interessato ha diritto di opporsi, in tutto o in parte:\r\n	<ul>\r\n		<li>&nbsp; &nbsp; a) per motivi legittimi al trattamento dei dati personali che lo riguardano, ancorch&egrave; pertinenti allo scopo della raccolta;</li>\r\n		<li>&nbsp; &nbsp; b) al trattamento di dati personali che lo riguardano a fini di invio di materiale pubblicitario o di vendita diretta o per il compimento di ricerche di mercato o di comunicazione commerciale.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Informativa D.Lgs 196/2003</p>\r\n\r\n<p>Codice in materia di protezione dei dati personali</p>\r\n\r\n<p>Il D.Lgs 196/2003 (Codice in materia di protezione dei dati personali), impone particolari cautele e rigorosi adempimenti, allo scopo di garantire che il trattamento dei dati personali si svolga nel rispetto dei diritti, delle libert&agrave; fondamentali, nonch&eacute; della dignit&agrave; delle persone fisiche, con particolare riguardo alla riservatezza e all&rsquo;identit&agrave; personale. In ottemperanza alla predetta Legge ed in particolare a quanto disposto dall&#39;articolo 13, La informiamo di quanto segue.</p>\r\n\r\n<ul>\r\n	<li>Il trattamento dei dati personali, da lei forniti inserendo le informazioni nei campi sotto evidenziati e che verranno inseriti nella banca dati &quot;Anagrafica Medici&quot;, &egrave; finalizzato:\r\n	<ul>\r\n		<li>Allo svolgimento di attivit&agrave; di informazione scientifica su medicinali per uso umano. L&#39;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. (in seguito anche I.B.I.) svolge detta attivit&agrave; nel rispetto di quanto previsto dalla normativa vigente con particolare, ma non esclusivo, riferimento al Decreto legislativo 30.12.1992 n. 541, cos&igrave; come successivamente modificato ed emendato. Date le finalit&agrave; perseguite dall&#39;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A., si precisa che il trattamento non ha per oggetto dati sensibili. Il conferimento dei dati per l&rsquo;attivit&agrave; di informazione scientifica &egrave; necessario e in mancanza del consenso non si potr&agrave; dare seguito alla finalit&agrave; su menzionata.</li>\r\n		<li>All&rsquo;invio di inviti o segnalazioni di congressi, convegni, seminari, comunicazioni relative ad iniziative promosse o sponsorizzate da I.B.I., invio di pubblicazioni periodiche od occasionali, informazioni su nuovi prodotti, metodologie, servizi. Tali attivit&agrave; potranno essere realizzate attraverso e-mail, fax, SMS, posta cartacea o contatto telefonico.&nbsp; Il conferimento dei dati per tale finalit&agrave; &egrave; facoltativo e senza il suo consenso non saranno trasmesse le informazioni ivi menzionate.</li>\r\n	</ul>\r\n	</li>\r\n	<li>I suoi dati non saranno diffusi ma potranno essere comunicati a persone, societ&agrave;, associazioni o studi professionali che prestino servizi o attivit&agrave; di assistenza e/o consulenza a I.B.I., alla rete di informatori medico-scientifici, ai nostri fornitori ed eventuali subfornitori all&#39;uopo incaricati e ove impegnati nell&rsquo;esecuzione di attivit&agrave; connesse con le finalit&agrave; sopra indicate, a societ&agrave; di mailing e di indagini statistiche o per invio di documentazione scientifica e a soggetti cui la facolt&agrave; di accedere ai dati sia riconosciuta da disposizioni di legge e/o di normativa secondaria.</li>\r\n	<li>Gli incaricati potranno venire a conoscenza dei suoi dati personali esclusivamente per le finalit&agrave; su menzionate.</li>\r\n	<li>Il Titolare del Trattamento &egrave; l&rsquo;Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. con sede legale in Via Fossignano 2, Aprilia (LT). Il Responsabile del trattamento &egrave; il responsabile della direzione medica, domiciliato per la funzione presso la sede legale della societ&agrave;; l&rsquo;elenco aggiornato degli altri Responsabili potr&agrave; essere visionato presso l&rsquo;ufficio del personale dell&rsquo;azienda.</li>\r\n	<li>La informiamo infine che potr&agrave; esercitare i diritti contemplati dall&#39;articolo 7 del Decreto Legislativo 196/03 tra cui quello di ottenere, dal Titolare o dal Responsabile, la conferma dell&rsquo;esistenza o meno di Suoi Dati personali e di &nbsp;consentirle, nel caso, la messa a disposizione. Lei potr&agrave; pertanto chiedere di avere conoscenza dell&rsquo;origine dei dati nonch&eacute; della logica e delle finalit&agrave; del Trattamento; di ottenere la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, nonch&eacute; l&rsquo;aggiornamento, la rettifica o, se vi &egrave; interesse, l&rsquo;integrazione dei dati stessi; di opporsi per motivi legittimi al trattamento oppure opporsi in parte al trattamento degli stessi (per esempio opponendosi ad una o pi&ugrave; delle modalit&agrave; di contatto indicate nel punto b della presente informativa). Lei potr&agrave; esercitare tali diritti scrivendo a: Istituto Biochimico Italiano Giovanni Lorenzini S.p.A. Via Fossignano, 2 - 04011 Aprilia (LT); oppure a <a href=\"mailto:info@ibi-lorenzini.com\">info@ibi-lorenzini.com</a>.</li>\r\n</ul>\r\n\r\n<p><strong>Per le Informazioni sul profilo utente</strong><br />\r\nL&rsquo;uso della password &egrave; strettamente personale e questa non deve essere divulgata. Dichiaro di aver preso visione delle norme di cui al D. Lgs. 30.12.1992 n. 541 e che le informazioni sono reali. Preso atto del contenuto dell&rsquo;Informativa D.Lgs. 196/2003 (Codice in materia di protezione dei dati personali) acconsento espressamente, ai sensi dell&rsquo;art. 23.</p>\r\n\r\n<div><!--[endif]--></div>\r\n','it'),
