	(89,45,'<h4>IL PROBLEMA</h4>\r\n\r\n<p>Il meteorismo &egrave; un disturbo frequente, dovuto alla presenza di quantit&agrave; eccessive di gas nello stomaco e nell&rsquo;intestino. Si manifesta con una sintomatologia caratterizzata inizialmente con fastidio addominale, senso di gonfiore e rumori intestinali (borborigmi), che, protraendosi nel tempo, possono complicarsi in forti dolori addominali e crampi. Il meteorismo si innesca durante il processo digestivo, quando gli zuccheri e la cellulosa &ldquo;fermentano&rdquo; nell&rsquo;intestino, con la conseguente formazione di azoto, metano e anidride carbonica. Una delle cause pi&ugrave; diffuse di questo disturbo &egrave; il cattivo funzionamento del colon, conosciuto come sindrome del colon irritabile, ma pu&ograve; derivare anche da intolleranze alimentari o, pi&ugrave; semplicemente, dal consumo di alcune fibre non idrosolubili, che tendono a fermentare e, di conseguenza, ad aumentare la produzione di gas. Gas di cui sono ricchi alcuni vegetali come i legumi (fagioli, piselli secchi e lenticchie), ma anche altre verdure a foglia verde (cavoli, broccoli e cavolfiori), la soia, i ravanelli, le cipolle, i cetrioli e i peperoni. Anche i cibi grassi (fritti, salse), quelli con alto contenuto di lattosio (latte, gelato, creme) e i dolcificanti artificiali (sorbitolo, mannitolo e prodotti che li contengono) possono favorire l&rsquo;accumulo di gas nello stomaco e nell&rsquo;intestino, come anche l&rsquo;abuso di t&egrave;, caff&egrave; o bevande gassate. Oltre alla fermentazione di zuccheri e carboidrati dovuta a cattiva digestione, il meteorismo pu&ograve; avere un&rsquo;altra causa: l&rsquo;aerofagia, cio&egrave; l&rsquo;ingestione di aria durante la deglutizione di cibi e bevande, che provoca nello stomaco il tipico gonfiore. Questo disturbo, dovuto alla formazione di bollicine d&rsquo;aria nella saliva, che vengono di seguito ingerite, dipende spesso da cattive abitudini come mangiare velocemente, masticare a lungo un chewing-gum o fumare.</p>\r\n\r\n<h4>LA SOLUZIONE</h4>\r\n\r\n<p>Oltre a modificare il proprio stile di vita e abitudini alimentari, Meteosim pu&ograve; rappresentare una valida soluzione al meteorismo e all&rsquo;aerofagia. &Egrave; un medicinale di automedicazione che favorisce l&rsquo;eliminazione dei gas nel tratto gastrointestinale. L&rsquo;efficacia di Meteosim &egrave; dovuta all&rsquo;azione del simeticone (dimeticone attivato), una miscela di polimeri di silicone combinati con diossido di silicio, che agisce localmente nell&rsquo;apparato gastrointestinale ed &egrave; capace di abbassare la tensione superficiale &ldquo;sequestrando&rdquo; il gas in eccesso e favorendone l&rsquo;eliminazione. Il simeticone fa in modo che le bolle di gas presenti confluiscano per poi essere eliminate pi&ugrave; facilmente alleviando i fastidiosi sintomi associati al meteorismo e all&rsquo;aerofagia. Il simeticone non viene assorbito dall&rsquo;organismo e non interferisce sull&rsquo;assorbimento delle sostanze nutritive agendo pertanto solo sui gas. L&rsquo;ampio campione di pazienti trattati in oltre 40 anni di utilizzo e l&rsquo;elevato numero di studi disponibili testimoniano l&rsquo;efficacia di simeticone nel ridurre la sintomatologia da eccessiva presenza di aria nel tratto gastrointestinale, indicazione confermata dalla Food and Drug Administration gi&agrave; nel 1973. Meteosim - simeticone - si pu&ograve; usare per curare disturbi lievi e transitori, facilmente riconoscibili e risolvibili: pu&ograve; essere quindi acquistato senza ricetta ma va usato correttamente per assicurarne l&rsquo;efficacia. Il medicinale non presenta particolari controindicazioni, salvo per ipersensibilit&agrave; al principio attivo o ad altri componenti del prodotto. &Egrave; generalmente controindicato nelle donne in gravidanza. Meteosim compresse masticabili La posologia suggerita per gli adulti &egrave; di 4 compresse al giorno, dopo i pasti o secondo prescrizione medica Simeticone IBI, bambini gocce orali, sospensione La posologia suggerita per i bambini &egrave; di 15 gocce, 2-4 volte al d&igrave;, dopo i pasti o secondo prescrizione medica</p>\r\n','it'),
